    false,nt"url": null,nt"notes": "During breeding season, cliff swallows
    are widely distributed throughout Alaska and North America south to Mexico, and
    they are locally common in western and southwestern Alaska (Kessel and Gibson 1978).
    In western Alaska, cliff swallows occur in colonies of 6-100 nests on the Seward
    Peninsula east of 166u00b0 west longitude (Kessel 1989). In the, Kilbuck and Ahklun
    Mountains of southwestern Alaska, colonies of 10-500 pairs occur along rivers and
    streams above treeline (circa 240 m asl), and small colonies occur infrequently
    at lower elevations (Petersen et al. In prep). Other reported colony sites in western
    Alaska include Unalakleet, St. Michael, Russian Mission, Holy Cross, and along the
    Andreafsky River (Bent 1963, Kessel and Gibson 1978, B. J. McCaffery Pers comm).
